import React from "react";
import "./App.css";
import Login from "./component/Login";
import Register from "./component/Register";

export default class App extends React.Component {
  state = {
    goToRegister: false,
  };

  render() {
    if (this.state.goToRegister)
      return (
        <div>
          <Register />;
        </div>
      );
    else return <Login />;

    return (
      <div className="App">
        <br />
        <button onClick>Register</button>
        <br />
        <br />
        <br />
        <br />
      </div>
    );
  }
}
